import React from 'react';
import { Container } from 'react-bootstrap';
import MenuItem from './MenuItem';

const Menu = () => {
    return (
        <Container className="other-sections" id="menu">
            <h2>Menu</h2>
            <MenuItem
                title="Biriyanis"
                items={[
                    {
                        name: "Hyderabadi Mutton Dum Biriyani",
                        price: "$50",
                        imageUrl: "/Biriyani.jpeg",
                    },
                    // Add more items for Biriyanis
                ]}
            />
            <MenuItem
                title="Haleems"
                reverse
                items={[
                    {
                        name: "Mutton Haleem",
                        price: "$80",
                        imageUrl: "/Haleem.jpeg",
                    },
                    // Add more items for Haleems
                ]}
            />
            <MenuItem
                title="Gravies"
                items={[
                    {
                        name: "Red Chicken Gravy",
                        price: "$60",
                        imageUrl: "/Chicken-Curry.jpeg",
                    },
                    // Add more items for Gravies
                ]}
            />
            <MenuItem
                title="Marag/Paya"
                reverse
                items={[
                    {
                        name: "Mutton Marag",
                        price: "$80",
                        imageUrl: "/Marag.jpeg",
                    },
                    // Add more items for Marag/Paya
                ]}
            />
        </Container>
    );
}

export default Menu;
